INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("2030/12/17 14:59:59", 24, 1, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, 24006, 0, 0.0, 109002, "2019/01/31 12:00:00", 0.0, 0.0, "エリコ（バレンタイン）", 10011);
